import React from 'react';

function ProductList({ onAddToCart }) {
  const products = [
    { id: 1, name: 'Beras Premium', price: 12000, stock: 100, image: 'image_url_1' },
    { id: 2, name: 'Beras Organik', price: 15000, stock: 50, image: 'image_url_2' },
    { id: 3, name: 'Beras Super', price: 10000, stock: 200, image: 'image_url_3' }
  ];

  return (
    <div className="product-list">
      {products.map((product) => (
        <div key={product.id} className="product-card">
          <img src={product.image} alt={product.name} />
          <h3>{product.name}</h3>
          <p>Harga: Rp {product.price}/kg</p>
          <p>Stok: {product.stock} kg</p>
          <button onClick={() => onAddToCart(product)}>Tambah ke Keranjang</button>
        </div>
      ))}
    </div>
  );
}

export default ProductList;
